//引入路由
import Vue from 'vue';
import Router from "vue-router"
Vue.use(Router);

const originalPush = Router.prototype.push
Router.prototype.push = function push(location) {
	return originalPush.call(this, location).catch(err => err)
}

import Index from '../view/index.vue'
import Login from '../view/login.vue'

import FrontCollector from '../view/front-collector.vue'
import FrontCollectorTable from '../view/front-collector-data.vue'
import RearCollector from '../view/rear-collector.vue'
import RearCollectorTable from '../view/rear-collector-data.vue'
import PowerLine from '../view/power-line.vue'

export default new Router({
	mode: 'history',
	routes: [{
		path: '/',
		name: '/',
		redirect: '/index',
		//redirect   表示当路径使用到‘/’是，就自动跳转到路径为‘/login’
	}, {
		path: '/index',
		name: 'Index',
		component: Index,
		children: [{
				path: '/index/front-collector',
				name: 'FrontCollector',
				meta: {
					title: '终端设备 / 前端采集器'
				},
				component: FrontCollector
			},
			{
				path: '/index/rear-collector',
				name: 'RearCollector',
				meta: {
					title: '终端设备 / 后端采集器'
				},
				component: RearCollector
			},
			{
				path: '/index/front-collector-table',
				name: 'FrontCollectorTable',
				meta: {
					title: '数据采集 / 前端数据采集'
				},
				component: FrontCollectorTable
			},
			{
				path: '/index/rear-collector-table',
				name: 'RearCollectorTable',
				meta: {
					title: '数据采集 / 后端端数据采集'
				},
				component: RearCollectorTable
			},
			{
				path: '/index/power-line',
				name: 'PowerLine',
				meta: {
					title: '图表展示 / 折线图'
				},
				component: PowerLine
			},
		]
	}]
})
